import React, { Component } from "react";
import Container from "../Container";
import Row from "../Row";
import Col from "../Col"; 


class Login extends Component {
    state = {
        email: "",
        password: "",
    }
    handleInputChange = event => {
        const { name, value } = event.target;
        this.setState({
            [name]: value
        });
    };

    handleFormSubmit = event => {
        event.preventDefault();
        this.setState({
            email: "",
            password: "",
            errors: {},

        });

    }
    render() {

        return (
            <div>
                <Container>
                    <form>
                        <div class="form-group text-white">
                            <label for="exampleFormControlInput1">Enter Email</label>
                            <input type="email" class="form-control" id="exampleFormControlInput1" placeholder="name@example.com" />
                        </div>
                        <div class="form-group text-white">
                            <label for="exampleFormControlInput1">Email Password</label>
                            <input type="password" class="form-control" id="exampleFormControlInput1" placeholder="name@example.com" />
                        </div>
                        <Row>
                            <Col size="md-12">
                                <button
                                    id="profileSearch"
                                    className="btn btn-info"
                                    onClick={this.handleFormSubmit}
                                >Search</button>
                            </Col>




                        </Row>
                    </form>
                </Container>
            </div>
        )
    }
}


export default Login;
